  return (
    <table className="result">
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      <tbody>
        {props.data.map((data) => {
          return (<tr>
            <td>{data.year}</td>
            <td>h</td>
            <td>{Math.round(data.yearlyInterest)}</td>
            <td>h</td>
            <td>h</td>
          </tr>)
          
        })}
      </tbody>
    </table>
  );
};

export default Table;
